import React from "react";
import {useState} from 'react'

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
} from "react-router-dom";


export default function Home(){

    return(
        <>   
        <Router>
          <Link to="/login">Login</Link>

          <Routes>
          <Route
                exact
                path="/login"
                element={<Login />}
                    />
            </Routes>
        </Router>
        </>

    );
};
